window.bookSummaryJSON = "<p>The Delvers LLC group is moving into the unknown. Tasked with a dangerous quest by Dolos, the god of Ludus, they have had to leave one of their members behind. Their journey will be full of shocking revelations as they learn more of Earth's ancient history.</p> <p>Forces of evil that have been gathering on Ludus have begun to act. Henry and Jason are rapidly being caught in the middle of a world war. The stakes have never been higher.</p> <p>Although great, the power they have acquired thus far might not be enough to survive. Will Delvers LLC be able to complete their next mission? More importantly, even if they do, is the fight for the planet one they can even win?</p> <p><b>About the series:&nbsp;Join Henry and Jason as they explore Ludus, struggling to survive on an alien planet full of magic and monsters. The two men from Earth will be forced to navigate new cultures and learn mysterious powers that they will have to master and use in creative ways.</b></p> <p><b>The two friends will make more allies along the way, even some they consider family. But in order to return home, they must finish the insane quest that Dolos, the god of Ludus, gave them. They will need an edge. Maybe modern know-how from Earth will be enough.</b></p>"; 
